import React, { Component } from 'react'

class Menu extends Component {
  render() {
    return(
      <div className='menu'>
        <div className='link-home'>
          <p>Home</p>
        </div>

        <div className='link-answeared'>
          <p>Answeared Questions</p>
        </div>
        <div className='link-add'>
          <p>Add Question</p>
        </div>
      </div>
    )
  }
}
export default Menu
